import { defineService, implementService } from '@wix/services-definitions';
import { SignalsServiceDefinition, } from '@wix/services-definitions/core-services/signals';
export const ScheduleItemsGroupServiceDefinition = defineService('scheduleItemsGroup');
export const ScheduleItemsGroupService = implementService.withConfig()(ScheduleItemsGroupServiceDefinition, ({ getService, config }) => {
    const signalsService = getService(SignalsServiceDefinition);
    const itemsGroup = signalsService.signal(config.itemsGroup);
    return { itemsGroup };
});
